  return (
    <div className="feed">
      <div className="feedWrapper">
        <p>Salut {localStorage.getItem("prenom")+ " " + localStorage.getItem("nom")}</p>
        <Share />
        {Posts.map((p) => (
          <Post key={p.id} post={p} />
        ))}
      </div>
    </div>
  );
}
